import React from 'react';

class MachineWorkTable extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div id="tableComponent">
                <div className="row upperTable">

                    <div className="col-sm-3">
                    <blockquote class="blockquote text-center">
                        <label class="radio-inline">
                            <input type="radio" name="optradio" checked />paid
                        </label>
                        <label class="radio-inline">
                            <input type="radio" name="optradio" />unpaid
                        </label>                    
                        </blockquote>                        
                    </div>

                    <div className="col-sm-3">
                        <blockquote class="blockquote text-center">
                            <p class="mb-0">Mahesh Party</p>
                            <footer class="blockquote-footer"> 7742879818</footer>
                        </blockquote>                        
                    </div>

                    <div className="col-sm-6">
                        <blockquote className="blockquote text-center">

                        </blockquote>
                    </div>
                </div>
                <div id="midTable"></div>
                <div id="lowerTable"></div>
            </div>
        );
    }
}

export default MachineWorkTable;
